{
  "translationLines": [
    {
      "lineNumber": 77141,
      "originalJapaneseLine": "ランスの剣の一閃がレッドアイの体をすり抜ける。",
      "translatedEnglishLine": "Lance's sword flash passed right through Red Eye's body."
    },
    {
      "lineNumber": 77142,
      "originalJapaneseLine": "「………………ウケ、けケケけ」",
      "translatedEnglishLine": "\"........... Uke, ke ke ke ke\""
    },
    {
      "lineNumber": 77143,
      "originalJapaneseLine": "「いわゆるひとつの……」",
      "translatedEnglishLine": "\"What you might call...\""
    },
    {
      "lineNumber": 77144,
      "originalJapaneseLine": "「メイクドラーーーーマーーーー！！！！」",
      "translatedEnglishLine": "\"Make-drama!!!!\""
    },
    {
      "lineNumber": 77145,
      "originalJapaneseLine": "雷に打たれたようにレッドアイは",
      "translatedEnglishLine": "Struck as if by lightning, Red Eye"
    },
    {
      "lineNumber": 77146,
      "originalJapaneseLine": "全身をガクガク震わせて、",
      "translatedEnglishLine": "shook his whole body violently,"
    },
    {
      "lineNumber": 77147,
      "originalJapaneseLine": "その場にバッタリと倒れた。",
      "translatedEnglishLine": "and collapsed flat on the spot."
    },
    {
      "lineNumber": 77148,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 77149,
      "originalJapaneseLine": "「――ぶはっ！」",
      "translatedEnglishLine": "\"—Buha!\""
    },
    {
      "lineNumber": 77150,
      "originalJapaneseLine": "全身から力が抜け、",
      "translatedEnglishLine": "All strength left his body,"
    },
    {
      "lineNumber": 77151,
      "originalJapaneseLine": "ランスはその場に腰を下ろした。",
      "translatedEnglishLine": "Lance lowered himself to sit down there."
    },
    {
      "lineNumber": 77152,
      "originalJapaneseLine": "「がははは！　どーーーだ、目玉野郎！」",
      "translatedEnglishLine": "\"Gahahaha! How's that, eyeball bastard!\""
    },
    {
      "lineNumber": 77153,
      "originalJapaneseLine": "「俺様が最強ーーーー！」",
      "translatedEnglishLine": "\"I am the strongest!\""
    },
    {
      "lineNumber": 77154,
      "originalJapaneseLine": "「は、はい、おめでとうございます、ランス様！」",
      "translatedEnglishLine": "\"Y-Yes, congratulations, Lord Lance!\""
    },
    {
      "lineNumber": 77155,
      "originalJapaneseLine": "「アニキ、格好いいぜ！」",
      "translatedEnglishLine": "\"Big brother, you're so cool!\""
    },
    {
      "lineNumber": 77156,
      "originalJapaneseLine": "「はぁー……まさか本当に勝っちゃうなんて……」",
      "translatedEnglishLine": "\"Hah... I never thought we'd actually win...\""
    },
    {
      "lineNumber": 77157,
      "originalJapaneseLine": "「ふふん、お前らへっぽことは違うということだ！」",
      "translatedEnglishLine": "\"Hmph, this just shows I'm different from you weaklings!\""
    },
    {
      "lineNumber": 77158,
      "originalJapaneseLine": "「がははははははははははははは！」",
      "translatedEnglishLine": "\"Gahahahahahahahahahaha!\""
    },
    {
      "lineNumber": 77159,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 77160,
      "originalJapaneseLine": "勝利に沸くランス達から離れた場所、",
      "translatedEnglishLine": "Away from Lance and the others celebrating their victory,"
    },
    {
      "lineNumber": 77161,
      "originalJapaneseLine": "地面をズルズルと進む物体があった。",
      "translatedEnglishLine": "There was an object dragging itself along the ground."
    },
    {
      "lineNumber": 77162,
      "originalJapaneseLine": "「ウケケケ、負け……負け……負け……」",
      "translatedEnglishLine": "\"Ukekeke, lost... lost... lost...\""
    },
    {
      "lineNumber": 77163,
      "originalJapaneseLine": "「あ、あ、あの、ヒューマン……",
      "translatedEnglishLine": "\"A-a-ano, human...\""
    },
    {
      "lineNumber": 77164,
      "originalJapaneseLine": "　ベリー、ベリー、強すぎる……」",
      "translatedEnglishLine": "Very, very too strong...\""
    },
    {
      "lineNumber": 77165,
      "originalJapaneseLine": "「う、う、うれし、うれし……ケケ……」",
      "translatedEnglishLine": "\"U-u-I'm happy, happy... keke...\""
    },
    {
      "lineNumber": 77166,
      "originalJapaneseLine": "「とてもとてもスイートな気分、ね。",
      "translatedEnglishLine": "\"A very, very sweet feeling, you know."
    },
    {
      "lineNumber": 77167,
      "originalJapaneseLine": "　これは次のリベンジがとっても楽しみ……」",
      "translatedEnglishLine": "I'm really looking forward to the next revenge...\""
    },
    {
      "lineNumber": 77168,
      "originalJapaneseLine": "「ウケ、うけけケケけケ、うひヒケけう……」",
      "translatedEnglishLine": "\"Uke, ukekeke kekeke, uhihi kekeu...\""
    },
    {
      "lineNumber": 77169,
      "originalJapaneseLine": "「まずはいわゆる一つの逃亡ね。",
      "translatedEnglishLine": "\"First, what you might call a getaway."
    },
    {
      "lineNumber": 77170,
      "originalJapaneseLine": "　ケケ、ケケケ、ミーが逃げる……",
      "translatedEnglishLine": "\"Keke, kekeke, I'm running away...\""
    },
    {
      "lineNumber": 77171,
      "originalJapaneseLine": "　楽し、楽し……」",
      "translatedEnglishLine": "Fun, fun...\""
    },
    {
      "lineNumber": 77172,
      "originalJapaneseLine": "「次はどんな奴に寄生して、",
      "translatedEnglishLine": "\"Next, who shall I parasitize,"
    },
    {
      "lineNumber": 77173,
      "originalJapaneseLine": "　あのヒューマン磨り潰すか……",
      "translatedEnglishLine": "to crush that human...\""
    },
    {
      "lineNumber": 77174,
      "originalJapaneseLine": "　ウケケ、想像するだけでとってもハッピー」",
      "translatedEnglishLine": "\"Ukeke, just imagining it makes me very happy.\""
    },
    {
      "lineNumber": 77175,
      "originalJapaneseLine": "「ふんっ！」",
      "translatedEnglishLine": "\"Hmph!\""
    },
    {
      "lineNumber": 77176,
      "originalJapaneseLine": "「ウゲッ！？",
      "translatedEnglishLine": "\"Uge!?\""
    },
    {
      "lineNumber": 77177,
      "originalJapaneseLine": "レッドアイの体に上からサテラが拳を叩き込んだ。",
      "translatedEnglishLine": "Satella slammed her fist down onto Red Eye's body from above."
    },
    {
      "lineNumber": 77178,
      "originalJapaneseLine": "「ふんっ、お前には散々苦労させられたからな、",
      "translatedEnglishLine": "\"Hmph, you've given me a lot of trouble,"
    },
    {
      "lineNumber": 77179,
      "originalJapaneseLine": "　どんなことするか想像はついている」",
      "translatedEnglishLine": "so I can imagine exactly what you'll try next.\""
    },
    {
      "lineNumber": 77180,
      "originalJapaneseLine": "「ノォーーーーー！",
      "translatedEnglishLine": "\"Nooooooo!\""
    },
    {
      "lineNumber": 77181,
      "originalJapaneseLine": "　ミーのボディに触れるノー！",
      "translatedEnglishLine": "\"Don't touch my body!\""
    },
    {
      "lineNumber": 77182,
      "originalJapaneseLine": "　ドンタッチミーーー！」",
      "translatedEnglishLine": "\"Don't touch meee!\""
    },
    {
      "lineNumber": 77183,
      "originalJapaneseLine": "「げっ、逃げ出してやがったのか！」",
      "translatedEnglishLine": "\"Geh, it escaped!\""
    },
    {
      "lineNumber": 77184,
      "originalJapaneseLine": "「詰めが甘いぞ、ランス」",
      "translatedEnglishLine": "\"You're careless, Lance.\""
    },
    {
      "lineNumber": 77185,
      "originalJapaneseLine": "「だがまぁ、ここまでレッドアイを",
      "translatedEnglishLine": "\"But still, I praise you for cornering Red Eye this far.\""
    },
    {
      "lineNumber": 77186,
      "originalJapaneseLine": "　追い詰めたことは褒めてやる」",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 77187,
      "originalJapaneseLine": "「さすがサテラの使徒だ」",
      "translatedEnglishLine": "\"As expected of Satella's disciple.\""
    },
    {
      "lineNumber": 77188,
      "originalJapaneseLine": "「ピギャビガガアァアァアアア！！」",
      "translatedEnglishLine": "\"Pigyabigaga aaaaaa!!\""
    },
    {
      "lineNumber": 77189,
      "originalJapaneseLine": "にこっと笑ってから",
      "translatedEnglishLine": "After smiling sweetly,"
    },
    {
      "lineNumber": 77190,
      "originalJapaneseLine": "サテラは思い切りレッドアイを砕く。",
      "translatedEnglishLine": "Satella smashed Red Eye brutally."
    }
  ]
}

